import IndexMenu from "./indexMenu";

export default function renderIndexMenu(type, item, relevantSearch, index, data) {
  if (type) {
    if (!type['highlighted'] && !data['display']['nonehighlighted']) return <div></div>

    if (item.length === 0) return <div></div>

    return <IndexMenu
      relevantSearch={relevantSearch} 
      index1={index[0]} 
      index2={index[1]} 
      index3={index[2]} 
      index4={index[3]} 
      index5={index[4]}
      index6={index[5]}
    />
  }
}
